import React from 'react';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import StarIcon from '@material-ui/icons/StarBorder';
import { makeStyles } from '@material-ui/core/styles';
import IuFootball from '../site-images/iu_football.png';
import OhioFootball from '../site-images/ohio_football.jpg';
import IowaFootball from '../site-images/iowa_football.jpg';
import Simeon from '../site-images/simeon.jpg';
import Kendall from '../site-images/kendall.jpg';

const useStyles = makeStyles(() => ({
    grid: {
        flexWrap: 'nowrap',
        transform: 'translateZ(0)',
    },
}));

const tiles = [
    {
        img: Simeon,
        features: false,
    },
    {
        img: Kendall,
        featured: false,
    },
    {
        img: IuFootball,
        featured: true,
    },
    {
        img: OhioFootball,
        featured: false,
    },
    {
        img: IowaFootball,
        featured: false,
    },
];

export default function GridListExample() {
    const classes = useStyles();
    return (
        
        <GridList 
            className={classes.grid}
            rows={1}
        >
            {tiles.map((tile, index) => {
                return (
                    <GridListTile 
                        key={index.toString()}
                        cols={tile.featured ? 2 : 1}
                    >
                        <img 
                            src={tile.img} 
                            alt='Excite User' 
                        />
                        <GridListTileBar 
                            title={
                                <Typography>
                                    Football around the country
                                </Typography>
                            }
                            subtitle={
                                <Typography>
                                    Take your pic
                                </Typography>
                            }
                            actionIcon={
                                <IconButton 
                                    style={{
                                        color: 'rgb(255, 255, 255)',
                                    }} 
                                >
                                    <StarIcon />
                                </IconButton>
                            }
                        />
                    </GridListTile>
                );
            })}
        </GridList>
    );
}
